selector_to_html = {"a[href=\"#switch-statements\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Switch Statements<a class=\"headerlink\" href=\"#switch-statements\" title=\"Permalink to this heading\">#</a></h1><p>An alternative to an if-statement ladder is the switch-statement.</p><p>A switch statement is generally easier to read than nested if statements.</p>", "a[href=\"#exampler1\"]": "<div class=\"example dropdown admonition\" id=\"exampler1\">\n<p class=\"admonition-title\"><span class=\"caption-number\">example 7 </span></p>\n<section id=\"example-content\">\n<div class=\"cell tag_remove-output docutils container\">\n<div class=\"cell_input docutils container\">\n<div class=\"highlight-C++ notranslate\"><div class=\"highlight\"><pre><span></span><span class=\"cp\">#include</span><span class=\"w\"> </span><span class=\"cpf\">&lt;iostream&gt;</span>\n<span class=\"kt\">int</span><span class=\"w\"> </span><span class=\"nf\">main</span><span class=\"p\">()</span><span class=\"w\"> </span><span class=\"p\">{</span>\n<span class=\"w\">\t</span><span class=\"k\">constexpr</span><span class=\"w\"> </span><span class=\"kt\">double</span><span class=\"w\"> </span><span class=\"n\">cm_per_inch</span><span class=\"w\"> </span><span class=\"o\">=</span><span class=\"w\"> </span><span class=\"mf\">2.54</span><span class=\"p\">;</span>\n<span class=\"w\">\t</span><span class=\"kt\">double</span><span class=\"w\"> </span><span class=\"n\">length</span><span class=\"w\"> </span><span class=\"o\">=</span><span class=\"w\"> </span><span class=\"mi\">1</span><span class=\"p\">;</span>\n<span class=\"w\">\t</span><span class=\"k\">while</span><span class=\"w\"> </span><span class=\"p\">(</span><span class=\"nb\">true</span><span class=\"p\">)</span><span class=\"w\"> </span><span class=\"p\">{</span>\n<span class=\"w\">\t\t</span><span class=\"kt\">char</span><span class=\"w\"> </span><span class=\"n\">unit</span><span class=\"w\"> </span><span class=\"o\">=</span><span class=\"w\"> </span><span class=\"sc\">'a'</span><span class=\"p\">;</span>\n<span class=\"w\">\t\t</span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cout</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"Please type in a length followed by a unit symbol, either c or i: </span><span class=\"se\">\\n</span><span class=\"s\">\"</span><span class=\"p\">;</span>\n<span class=\"w\">\t\t</span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cin</span><span class=\"w\"> </span><span class=\"o\">&gt;&gt;</span><span class=\"w\"> </span><span class=\"n\">length</span><span class=\"w\"> </span><span class=\"o\">&gt;&gt;</span><span class=\"w\"> </span><span class=\"n\">unit</span><span class=\"p\">;</span>\n<span class=\"w\">\t\t</span><span class=\"k\">switch</span><span class=\"w\"> </span><span class=\"p\">(</span><span class=\"n\">unit</span><span class=\"p\">)</span><span class=\"w\"> </span><span class=\"p\">{</span>\n<span class=\"w\">\t\t</span><span class=\"k\">case</span><span class=\"w\"> </span><span class=\"sc\">'i'</span><span class=\"p\">:</span>\n<span class=\"w\">\t\t\t</span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cout</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"n\">length</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"in==\"</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"n\">cm_per_inch</span><span class=\"w\"> </span><span class=\"o\">*</span><span class=\"w\"> </span><span class=\"n\">length</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"cm.</span><span class=\"se\">\\n</span><span class=\"s\">\"</span><span class=\"p\">;</span>\n<span class=\"w\">\t\t\t</span><span class=\"k\">break</span><span class=\"p\">;</span>\n<span class=\"w\">\t\t</span><span class=\"k\">case</span><span class=\"w\"> </span><span class=\"sc\">'c'</span><span class=\"p\">:</span>\n<span class=\"w\">\t\t\t</span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cout</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"n\">length</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"cm==\"</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"n\">length</span><span class=\"w\"> </span><span class=\"o\">/</span><span class=\"w\"> </span><span class=\"n\">cm_per_inch</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"in.</span><span class=\"se\">\\n</span><span class=\"s\">\"</span><span class=\"p\">;</span>\n<span class=\"w\">\t\t\t</span><span class=\"k\">break</span><span class=\"p\">;</span>\n<span class=\"w\">\t\t</span><span class=\"k\">default</span><span class=\"o\">:</span>\n<span class=\"w\">\t\t\t</span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cout</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"Sorry, I do not know what that unit is....</span><span class=\"se\">\\n</span><span class=\"s\">\"</span><span class=\"p\">;</span>\n<span class=\"w\">\t\t\t</span><span class=\"k\">break</span><span class=\"p\">;</span>\n<span class=\"w\">\t\t</span><span class=\"p\">}</span>\n<span class=\"w\">\t</span><span class=\"p\">}</span>\n<span class=\"p\">}</span>\n</pre></div>\n</div>\n</div>\n</div>\n<div class=\"explanation dropdown note admonition\" id=\"explanationr1\">\n<p class=\"admonition-title\">Explanation of<a class=\"reference internal\" href=\"#exampler1\"> Example 7</a></p>\n<section id=\"explanation-content\">\n<p>In this example, the while loop is just to keep the program running \u2013 we are only interested in the switch loop.</p>\n<p>constexpr double cm_per_inch = 2.54 - the conversion factor.</p>\n<p>Every time the while loop runs, the user is asked to input a value for \u2018unit\u2019, and then the switch statement runs, using unit as its condition.</p>\n<p>There are two cases - switching to their code block if the condtion yield a value of \u2018i\u2019 or \u2018c\u2019.</p>\n<p>The break statements cause the program to exit the switch-statement after completing the successful switch.</p>\n<p>If neither \u2018i\u2019 nor \u2018c\u2019 is typed in then the default case is executed.</p>\n<p>The value in parentheses after the switch keyword is compared to the case values. A match to a case causes its code block to execute The syntax requires each case to be terminated by a break. If no case is true, then the default code block is executed.</p>\n<div class=\"exercise dropdown admonition\" id=\"jupyternotebooks/switch_statements-exercise-2\">\n<p class=\"admonition-title\"><span class=\"caption-number\">Exercise 16 </span></p>\n<section id=\"exercise-content\">\n<ul class=\"simple\">\n<li><p>Try removing the break statement from the default case.</p></li>\n<li><p>Try removing the second break statements.</p></li>\n<li><p>Try removing all first and second break statements.</p></li>\n<li><p>Try writing two cases, both with the case label \u2018c\u2019.</p></li>\n</ul>\n</section>\n</div>\n</section>\n</div>\n</section>\n</div>", "a[href=\"#exampler2\"]": "<div class=\"example dropdown admonition\" id=\"exampler2\">\n<p class=\"admonition-title\"><span class=\"caption-number\">example 8 </span></p>\n<section id=\"example-content\">\n<div class=\"cell tag_remove-output docutils container\">\n<div class=\"cell_input docutils container\">\n<div class=\"highlight-C++ notranslate\"><div class=\"highlight\"><pre><span></span><span class=\"cp\">#include</span><span class=\"w\"> </span><span class=\"cpf\">&lt;iostream&gt;</span>\n<span class=\"kt\">int</span><span class=\"w\"> </span><span class=\"nf\">main</span><span class=\"p\">()</span><span class=\"w\"> </span><span class=\"p\">{</span>\n\n\n<span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cout</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"please enter an expression to be evaluated (only +,-,*,/ for now, ADD an x to show the end of your expression):\"</span><span class=\"p\">;</span>\n<span class=\"kt\">int</span><span class=\"w\"> </span><span class=\"n\">lhs</span><span class=\"w\"> </span><span class=\"o\">=</span><span class=\"w\"> </span><span class=\"mi\">0</span><span class=\"p\">;</span>\n<span class=\"kt\">int</span><span class=\"w\"> </span><span class=\"n\">rhs</span><span class=\"w\"> </span><span class=\"o\">=</span><span class=\"w\"> </span><span class=\"mi\">0</span><span class=\"p\">;</span>\n<span class=\"kt\">int</span><span class=\"w\"> </span><span class=\"n\">result</span><span class=\"p\">;</span>\n<span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cin</span><span class=\"w\"> </span><span class=\"o\">&gt;&gt;</span><span class=\"w\"> </span><span class=\"n\">lhs</span><span class=\"p\">;</span>\n<span class=\"k\">if</span><span class=\"w\"> </span><span class=\"p\">(</span><span class=\"o\">!</span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cin</span><span class=\"p\">)</span><span class=\"w\"> </span><span class=\"k\">throw</span><span class=\"w\"> </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">runtime_error</span><span class=\"p\">(</span><span class=\"s\">\"no first operand\"</span><span class=\"p\">);</span>\n<span class=\"w\">\t</span><span class=\"k\">for</span><span class=\"w\"> </span><span class=\"p\">(</span><span class=\"kt\">char</span><span class=\"w\"> </span><span class=\"n\">operation</span><span class=\"p\">;</span><span class=\"w\"> </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cin</span><span class=\"w\"> </span><span class=\"o\">&gt;&gt;</span><span class=\"w\"> </span><span class=\"n\">operation</span><span class=\"p\">;)</span><span class=\"w\"> </span><span class=\"p\">{</span><span class=\"w\"> </span><span class=\"c1\">//keeps reading cin until it gets an operator</span>\n<span class=\"w\">\t\t</span><span class=\"k\">if</span><span class=\"w\"> </span><span class=\"p\">(</span><span class=\"n\">operation</span><span class=\"w\"> </span><span class=\"o\">!=</span><span class=\"w\"> </span><span class=\"sc\">'x'</span><span class=\"p\">)</span><span class=\"w\"> </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cin</span><span class=\"w\"> </span><span class=\"o\">&gt;&gt;</span><span class=\"w\"> </span><span class=\"n\">rhs</span><span class=\"p\">;</span>\n<span class=\"w\">\t\t</span><span class=\"k\">if</span><span class=\"w\"> </span><span class=\"p\">(</span><span class=\"o\">!</span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cin</span><span class=\"p\">)</span><span class=\"w\"> </span><span class=\"k\">throw</span><span class=\"w\"> </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">runtime_error</span><span class=\"p\">(</span><span class=\"s\">\"no second operand\"</span><span class=\"p\">);</span>\n<span class=\"w\">\u00a0</span>\n<span class=\"w\">\t\t</span><span class=\"k\">switch</span><span class=\"w\"> </span><span class=\"p\">(</span><span class=\"n\">operation</span><span class=\"p\">)</span><span class=\"w\"> </span><span class=\"p\">{</span>\n<span class=\"w\">\t\t</span><span class=\"k\">case</span><span class=\"w\"> </span><span class=\"sc\">'+'</span><span class=\"p\">:</span>\n<span class=\"w\">\t\t\t</span><span class=\"n\">result</span><span class=\"w\"> </span><span class=\"o\">=</span><span class=\"w\"> </span><span class=\"n\">lhs</span><span class=\"w\"> </span><span class=\"o\">+</span><span class=\"w\"> </span><span class=\"n\">rhs</span><span class=\"p\">;</span>\n<span class=\"w\">\t\t\t</span><span class=\"k\">break</span><span class=\"p\">;</span>\n<span class=\"w\">\t\t</span><span class=\"k\">case</span><span class=\"w\"> </span><span class=\"sc\">'-'</span><span class=\"p\">:</span>\n<span class=\"w\">\t\t\t</span><span class=\"n\">result</span><span class=\"w\"> </span><span class=\"o\">=</span><span class=\"w\"> </span><span class=\"n\">lhs</span><span class=\"w\"> </span><span class=\"o\">-</span><span class=\"w\"> </span><span class=\"n\">rhs</span><span class=\"p\">;</span>\n<span class=\"w\">\t\t\t</span><span class=\"k\">break</span><span class=\"p\">;</span>\n<span class=\"w\">\t\t</span><span class=\"k\">case</span><span class=\"w\"> </span><span class=\"sc\">'*'</span><span class=\"p\">:</span>\n<span class=\"w\">\t\t\t</span><span class=\"n\">result</span><span class=\"w\"> </span><span class=\"o\">=</span><span class=\"w\"> </span><span class=\"n\">lhs</span><span class=\"w\"> </span><span class=\"o\">*</span><span class=\"w\"> </span><span class=\"n\">rhs</span><span class=\"p\">;</span>\n<span class=\"w\">\t\t\t</span><span class=\"k\">break</span><span class=\"p\">;</span>\n<span class=\"w\">\t\t</span><span class=\"k\">case</span><span class=\"w\"> </span><span class=\"sc\">'/'</span><span class=\"p\">:</span>\n<span class=\"w\">\t\t\t</span><span class=\"n\">result</span><span class=\"w\"> </span><span class=\"o\">=</span><span class=\"w\"> </span><span class=\"n\">lhs</span><span class=\"w\"> </span><span class=\"o\">/</span><span class=\"w\"> </span><span class=\"n\">rhs</span><span class=\"p\">;</span>\n<span class=\"w\">\t\t\t</span><span class=\"k\">break</span><span class=\"p\">;</span>\n<span class=\"w\">\t\t</span><span class=\"k\">default</span><span class=\"o\">:</span>\n<span class=\"w\">\t\t\t</span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cout</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"n\">result</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"sc\">'\\n'</span><span class=\"p\">;</span>\n<span class=\"w\">\t\t\t</span><span class=\"k\">return</span><span class=\"w\"> </span><span class=\"mi\">0</span><span class=\"p\">;</span>\n<span class=\"w\">\t\t</span><span class=\"p\">}</span>\n<span class=\"w\">\t\t</span><span class=\"n\">lhs</span><span class=\"w\"> </span><span class=\"o\">=</span><span class=\"w\"> </span><span class=\"n\">result</span><span class=\"p\">;</span>\n<span class=\"w\">\t</span><span class=\"p\">}</span>\n<span class=\"w\">\t\t</span>\n<span class=\"w\">\t</span><span class=\"k\">throw</span><span class=\"w\"> </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">runtime_error</span><span class=\"p\">(</span><span class=\"s\">\"bad expression\"</span><span class=\"p\">);</span>\n</pre></div>\n</div>\n</div>\n</div>\n<div class=\"explanation dropdown note admonition\" id=\"explanationr2\">\n<p class=\"admonition-title\">Explanation of<a class=\"reference internal\" href=\"#exampler2\"> Example 8</a></p>\n<section id=\"explanation-content\">\n<div class=\"exercise dropdown admonition\" id=\"jupyternotebooks/switch_statements-exercise-5\">\n<p class=\"admonition-title\"><span class=\"caption-number\">Exercise 17 </span></p>\n<section id=\"exercise-content\">\n</section>\n</div>\n</section>\n</div>\n</section>\n</div>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false, theme: 'material', duration: [200, 100], delay: [200, 0],

            });
        };
    };
    console.log("tippy tips loaded!");
};
